INSERT INTO `category` (`id`, `list_position`, `catalogue_id`, `parent_id`, `name`, `description`, `meta_desc`, `meta_keys`, `icon`) VALUES
(1, 1, 1, 3, 'Эпоксидные смолы', '<p><span class="ql-size-large">Э</span>поксидная смола – продукт синтетического происхождения, получаемый в результате поликонденсации эпихлоргидрина в сочетании с фенолами. Данный материал отличается универсальностью, что определяет широкую сферу его использования: из всех видов смол только эпоксидная используется так часто при производстве материалов композитного состава. Высокая востребованность продукции данного вида неслучайна, так как именно эпоксидная смола дает лучшие результаты по прочности и иным качественным параметрам, сохраняя привлекательную цену и доступность.</p>', 'Эпоксидная смола', 'смола,эпоксидная', NULL),
(2, 2, 1, NULL, 'Отвердители', 'Отвердитель – соединение особого вида, вводимое в небольших дозах в отделочные и строительные материалы, а также в эпоксидную смолу.\r\nТакие соединения предназначены для перевода основного материала в твердую форму. В случае с эпоксидной смолой отвердители используются для полимеризации, при этом процесс перевода пластичной смолы в твердое состояние может происходить как с нагревом смеси, так и без него.\r\nРазличные типы отвердителей могут состоять из разнообразных соединений: амины, ангидриды, перекись бензоила, кислоты разного типа.', 'Отвердители', 'отвердитель', NULL),
(3, 3, 1, NULL, 'Добавки и катализаторы', 'В роли добавок и катализаторов для эпоксидных смол выступают вещества, добавляемые в малых дозах эпоксидную смолу с отвердителем, что стимулирует ускорение протекающих реакций.\r\nТочная дозировка добавок определяется потребностью в конечных свойствах, которыми будет обладать конечный продукт.\r\nПрименение ускорителей оправдано при значительных объемах выполняемых работ и небольших сроках на их проведение. Равно как при использовании в составе долготвердеющей эпоксидной смолы.\r\n ', 'добавки и отвердители', 'добавки, отвердители', NULL),
(4, 4, 1, 3, 'Алкофен (DMP-30) в Казани', 'Алкофен входит в группу добавок и катализаторов для эпоксидных смол и выступает в качестве компонента для изготовления композитной стеклопластиковой арматуры. С его помощью осуществляется ускорение полимеризации связующего агента, благодаря чему процесс производства армирующих материалов получил промышленный масштаб. При отсутствии ускорителя и температурного воздействия на процесс полимеризация эпоксидной смолы занимала бы несколько часов.\r\n\r\nПо внешнему виду Алкофен – однородная прозрачная жидкость вязкой структуры, может иметь несколько оттенков (от светлого до темно-янтарного). В отвердителе отсутствуют посторонние включения и примеси.', 'алкофен', 'алкофен', NULL),
(5, 5, 1, NULL, 'Ровинг (стекловолокно)', 'Ровинг представляет собой изделие стекловолоконного типа в виде тонкой нити c не скручивающимися между собой волокнами.\r\n\r\nДля лучшей пропитки изделия полиэфирными, эпоксидными и другими видами смол в его состав включаются замасливатели. Для удобства транспортировки и дальнейшего использования материал наматывается на бобины, обтягиваемые герметично прилегаемой пленкой.\r\n\r\nВ результате производственных процессов ровинг становится прочным материалом с отличными физико-механическими качествами. Лежащее в основе стекло наделяет материал невосприимчивостью к коррозии, а также воздействию других химвеществ, материал отличается легким весом, термоустойчивостью, проявляет свойства диэлектрика.', 'Ровинг (стекловолокно)', 'стекловолокно', NULL),
(6, 1, 2, NULL, 'Все для производства', 'Тестовая категория интуитивного каталога', 'Все для производства', 'для производства, ', ),
(10, 2, 2, NULL, 'тест', 'тест изображений', 'тест', 'тест', );

